import * as React from 'react';

import { Field } from '@progress/kendo-react-form';

import {FormInput, FormAutoComplete, FormRadioGroup,FormTextArea} from './form-components';

import {
    nameValidator, requiredValidator, regNoValidator
} from './validators'

import {countries, genders } from './data'


export const EducationalDetails = (
    <div>
        
    <Field
      key={'metrollNo'}
      id={'metrollNo'}
      name={'metrollNo'}
      label={'MET Roll No.'}
      component={FormInput}
      validator={nameValidator}
        />
          <Field
      key={'metrank'}
      id={'metrank'}
      name={'metrank'}
      label={'MET Rank'}
      component={FormInput}
      validator={nameValidator}
        />         
    
    <Field
      key={'metscore'}
      id={'metscore'}
      name={'metscore'}
      label={'MET Score'}
      layout={'horizontal'}
      component={FormI}
      validator={nameValidator}
        />
        
        <Field
      key={'program'}
      id={'program'}
      name={'program'}
      label={'Program Name'}
      component={FormInput}
      validator={requiredValidator} 
        />
        <Field
      key={'stream'}
      id={'stream'}
      name={'stream'}
      label={'Stream'}
      component={FormInput}
       validator={requiredValidator}
        />
        <Field
      key={'year'}
      id={'year'}
      name={'year'}
      label={'Year'}
      component={FormInput}
      validator={requiredValidator} 
        />
        <Field
      key={'semester'}
      id={'semester'}
      name={'semester'}
      label={'Semester'}
      component={FormInput}
      validator={requiredValidator} 
        />
        <Field
      key={'mobno'}
      id={'mobno'}
      name={'mobno'}
      label={'Mobile Number'}
      component={FormInput}
      validator={requiredValidator} 
        />
         <Field
      key={'dob'}
      id={'dob'}
      name={'dob'}
      label={'D.O.B'}
      component={FormInput}
      validator={requiredValidator} 
        />
          <Field
      key={'emailID'}
      id={'emailID'}
      name={'emailID'}
      label={'Email ID'}
      component={FormInput}
      validator={requiredValidator} 
        />

         <Field
      key={'premAdd'}
      id={'premAdd'}
      name={'premAdd'}
      label={'Permanent Address'}
      component={FormTextArea}
      validator={requiredValidator} 
        />
         <Field
      key={'presAdd'}
      id={'presAdd'}
      name={'pressAdd'}
      label={'Present Address'}
      component={FormTextArea}
      validator={requiredValidator}
        />  
        


    
  </div>
);
